import{_ as n,W as s,X as a,Z as e}from"./framework-ca8d4a1d.js";const t="/img/python/base/013.png",p={},i=e(`<p>函数是组织好的，可重复使用的，用来实现特定功能的代码段。</p><p><strong>种类</strong></p><ul><li>内置函数：Python语言内置的函数，可直接使用。 <ul><li>如之前用过的：input()、print()、int()、str()等</li></ul></li><li>自定义函数：自己手动定义的函数。</li><li>第三方函数：引入的他人开发的函数，避免重复造轮子。</li></ul><p><strong>函数的意义</strong></p><ul><li>将功能封装在函数内，可供随时随地重复利用</li><li>提高代码的复用性，减少重复代码，提高开发效率</li></ul><h2 id="i-创建函数" tabindex="-1"><a class="header-anchor" href="#i-创建函数" aria-hidden="true">#</a> Ⅰ. 创建函数</h2><h4 id="_1-语法" tabindex="-1"><a class="header-anchor" href="#_1-语法" aria-hidden="true">#</a> 1. 语法</h4><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>def 函数名(参数...):
    函数体
    return 返回值
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ul><li>def：必备，定义函数的关键字，函数代码块以 def 关键词开头。</li><li>函数名：必备，函数标识符名称，调用的使用要用</li><li>参数：可选，任何传入参数和自变量必须放在圆括号中间。</li><li>函数体：必备，函数的内容以冒号和缩进开始</li><li>返回值：可选，用于结束函数，并向函数调用处返回一个值</li></ul><h4 id="_2-简单示例" tabindex="-1"><a class="header-anchor" href="#_2-简单示例" aria-hidden="true">#</a> 2. 简单示例</h4><p>创建一个无参数、无返回值的简单函数。</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">get_info</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string">&quot;don&#39;t touch my ass , I&#39;m real man&quot;</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_3-调用函数" tabindex="-1"><a class="header-anchor" href="#_3-调用函数" aria-hidden="true">#</a> 3. 调用函数</h4><div class="hint-container tip"><p class="hint-container-title">提示</p><p>很多语言由于加载方式的原因，函数是可以先调用，后创建的（此时函数已经在内存里了），而Python不支持。</p></div><p>使用 <code>函数名(参数)</code> 的形式调用，可以多次调用。<br> 调用前函数必须已经声明。</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code>get_info<span class="token punctuation">(</span><span class="token punctuation">)</span>  <span class="token comment"># 没有参数就不用传参数</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h4 id="_4-函数命名规范" tabindex="-1"><a class="header-anchor" href="#_4-函数命名规范" aria-hidden="true">#</a> 4. 函数命名规范</h4><h2 id="ii-参数" tabindex="-1"><a class="header-anchor" href="#ii-参数" aria-hidden="true">#</a> Ⅱ. 参数</h2><h4 id="_1-介绍" tabindex="-1"><a class="header-anchor" href="#_1-介绍" aria-hidden="true">#</a> 1.介绍</h4><p>在函数调用的时候，可以给函数传递参数，让函数执行的时候可以获取外部数据。</p><ul><li>形参：函数定义时给出的参数，用于占位</li><li>实参：函数调用时实际传入到函数的中的参数，会赋值给形参</li></ul><h4 id="_2-参数规则" tabindex="-1"><a class="header-anchor" href="#_2-参数规则" aria-hidden="true">#</a> 2. 参数规则</h4><ul><li>参数数量没有限制，可以是0个，也可以是任意N个。</li><li>参数之间使用逗号进行分割</li><li>传入参数时，默认按照顺序将实参赋值给形参</li></ul><h4 id="_3-创建带参函数" tabindex="-1"><a class="header-anchor" href="#_3-创建带参函数" aria-hidden="true">#</a> 3. 创建带参函数</h4><p>如下：创建一个计算两数之和函数.</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">get_sum</span><span class="token punctuation">(</span>num1<span class="token punctuation">,</span> num2<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string-interpolation"><span class="token string">f&quot;计算结果为：</span><span class="token interpolation"><span class="token punctuation">{</span>num1<span class="token operator">+</span>num2<span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">)</span>


get_sum<span class="token punctuation">(</span><span class="token number">10</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">)</span>  <span class="token comment"># 计算结果为：30</span>
get_sum<span class="token punctuation">(</span><span class="token number">45</span><span class="token punctuation">,</span> <span class="token number">54</span><span class="token punctuation">)</span>  <span class="token comment"># 计算结果为：99</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="iii-多种传参方式" tabindex="-1"><a class="header-anchor" href="#iii-多种传参方式" aria-hidden="true">#</a> Ⅲ. 多种传参方式</h2><p>函数有4中常见参数使用方式:</p><ul><li>位置参数</li><li>关键字参数</li><li>缺省参数</li><li>不定长参数</li></ul><h4 id="_1-位置参数" tabindex="-1"><a class="header-anchor" href="#_1-位置参数" aria-hidden="true">#</a> 1. 位置参数</h4><p>调用函数时根据函数定义的参数位置来传递参数。<br> 传递的参数和定义的参数的顺序及个数必须一致</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">setInfo</span><span class="token punctuation">(</span>name<span class="token punctuation">,</span> age<span class="token punctuation">,</span> gender<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string-interpolation"><span class="token string">f&quot;名字：</span><span class="token interpolation"><span class="token punctuation">{</span>name<span class="token punctuation">}</span></span><span class="token string">，年龄：</span><span class="token interpolation"><span class="token punctuation">{</span>age<span class="token punctuation">}</span></span><span class="token string">，性别：</span><span class="token interpolation"><span class="token punctuation">{</span>gender<span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">)</span>


setInfo<span class="token punctuation">(</span><span class="token string">&quot;Victor&quot;</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">,</span> <span class="token string">&quot;male&quot;</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_2-关键字参数" tabindex="-1"><a class="header-anchor" href="#_2-关键字参数" aria-hidden="true">#</a> 2. 关键字参数</h4><p>函数调用时通过“键=值”形式传递参数。</p><ul><li>可以让函数更加清晰、容易使用，同时也清除了参数的顺序需求。</li><li>可以和位置参数混用，如果有位置参数时，位置参数必须在关键字参数的前面。</li></ul><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">setInfo</span><span class="token punctuation">(</span>name<span class="token punctuation">,</span> age<span class="token punctuation">,</span> gender<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string-interpolation"><span class="token string">f&quot;名字：</span><span class="token interpolation"><span class="token punctuation">{</span>name<span class="token punctuation">}</span></span><span class="token string">，年龄：</span><span class="token interpolation"><span class="token punctuation">{</span>age<span class="token punctuation">}</span></span><span class="token string">，性别：</span><span class="token interpolation"><span class="token punctuation">{</span>gender<span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">)</span>


setInfo<span class="token punctuation">(</span>name<span class="token operator">=</span><span class="token string">&quot;victor&quot;</span><span class="token punctuation">,</span> gender<span class="token operator">=</span><span class="token string">&quot;male&quot;</span><span class="token punctuation">,</span> age<span class="token operator">=</span><span class="token number">20</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_3-缺省参数" tabindex="-1"><a class="header-anchor" href="#_3-缺省参数" aria-hidden="true">#</a> 3. 缺省参数</h4><p>缺省参数也叫默认参数，用于定义函数，为参数提供默认值，调用函数时可不传该默认参数的值。</p><p>注意：所有位置参数必须出现在默认参数前，包括函数定义和调用.<br> 作用: 当调用函数时没有传递参数, 就会使用默认是用缺省参数对应的值.</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">setInfo</span><span class="token punctuation">(</span>name<span class="token punctuation">,</span> age<span class="token punctuation">,</span> gender<span class="token operator">=</span><span class="token string">&quot;female&quot;</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string-interpolation"><span class="token string">f&quot;名字：</span><span class="token interpolation"><span class="token punctuation">{</span>name<span class="token punctuation">}</span></span><span class="token string">，年龄：</span><span class="token interpolation"><span class="token punctuation">{</span>age<span class="token punctuation">}</span></span><span class="token string">，性别：</span><span class="token interpolation"><span class="token punctuation">{</span>gender<span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">)</span>


setInfo<span class="token punctuation">(</span><span class="token string">&quot;Victor&quot;</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">)</span>
setInfo<span class="token punctuation">(</span><span class="token string">&quot;Victor&quot;</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">,</span> <span class="token string">&quot;male&quot;</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_4-不定长参数" tabindex="-1"><a class="header-anchor" href="#_4-不定长参数" aria-hidden="true">#</a> 4. 不定长参数</h4><p>不定长参数也叫可变参数. 用于不确定调用的时候会传递多少个参数(不传参也可以)的场景.</p><p>当调用函数时不确定参数个数时, 可以使用不定长参数。</p><h5 id="_4-1-位置传递" tabindex="-1"><a class="header-anchor" href="#_4-1-位置传递" aria-hidden="true">#</a> 4.1 位置传递</h5><p>传进的所有参数都会被args变量收集，它会根据传进参数的位置合并为一个元组(tuple)，args是元组类型，这就是位置传递。</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">setInfo</span><span class="token punctuation">(</span><span class="token operator">*</span>args<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span>args<span class="token punctuation">)</span>  <span class="token comment"># (&#39;Victor&#39;, 20, &#39;male&#39;)</span>
    <span class="token keyword">for</span> key <span class="token keyword">in</span> args<span class="token punctuation">:</span>
        <span class="token keyword">print</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span>


setInfo<span class="token punctuation">(</span><span class="token string">&quot;Victor&quot;</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">,</span> <span class="token string">&quot;male&quot;</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h5 id="_4-2-关键字传递" tabindex="-1"><a class="header-anchor" href="#_4-2-关键字传递" aria-hidden="true">#</a> 4.2 关键字传递</h5><p>参数是“键=值”形式的形式的情况下, 所有的“键=值”都会被kwargs接受, 同时会根据“键=值”组成字典.</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">setInfo</span><span class="token punctuation">(</span><span class="token operator">**</span>args<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span>args<span class="token punctuation">)</span>  <span class="token comment"># {&#39;name&#39;: &#39;victor&#39;, &#39;gender&#39;: &#39;male&#39;, &#39;age&#39;: 20}</span>
    <span class="token keyword">for</span> key <span class="token keyword">in</span> args<span class="token punctuation">:</span>
        <span class="token keyword">print</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span>


setInfo<span class="token punctuation">(</span>name<span class="token operator">=</span><span class="token string">&quot;victor&quot;</span><span class="token punctuation">,</span> gender<span class="token operator">=</span><span class="token string">&quot;male&quot;</span><span class="token punctuation">,</span> age<span class="token operator">=</span><span class="token number">20</span><span class="token punctuation">)</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="iv-返回值" tabindex="-1"><a class="header-anchor" href="#iv-返回值" aria-hidden="true">#</a> Ⅳ. 返回值</h2><h4 id="_1-介绍-1" tabindex="-1"><a class="header-anchor" href="#_1-介绍-1" aria-hidden="true">#</a> 1. 介绍</h4><p>函数可以只完成一些功能，也可以返回一个值给函数的调用处。</p><h4 id="_2-return语句" tabindex="-1"><a class="header-anchor" href="#_2-return语句" aria-hidden="true">#</a> 2. return语句</h4><p>函数的返回值就是通过return语句完成的，return会将后面的值返回给函数调用处（可以用变量接收）。<br> 同时，return还表示立即退出当前函数，return后面的函数体不会执行。</p><h4 id="_3-返回值示例" tabindex="-1"><a class="header-anchor" href="#_3-返回值示例" aria-hidden="true">#</a> 3. 返回值示例</h4><p>需求：计算两数之和，并将计算结果返回</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">get_sum</span><span class="token punctuation">(</span>num1<span class="token punctuation">,</span> num2<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">return</span> num1 <span class="token operator">+</span> num2
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string">&quot;这行代码是不会执行的&quot;</span><span class="token punctuation">)</span>


result1 <span class="token operator">=</span> get_sum<span class="token punctuation">(</span><span class="token number">10</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">)</span>  <span class="token comment"># 返回值赋值给了变量</span>
result2 <span class="token operator">=</span> get_sum<span class="token punctuation">(</span><span class="token number">45</span><span class="token punctuation">,</span> <span class="token number">54</span><span class="token punctuation">)</span>
<span class="token keyword">print</span><span class="token punctuation">(</span>result1<span class="token punctuation">,</span> result2<span class="token punctuation">)</span>  <span class="token comment"># 30 99</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_4-none" tabindex="-1"><a class="header-anchor" href="#_4-none" aria-hidden="true">#</a> 4. None</h4><p>如果函数没有使用return语句返回数据，那么函数会隐式的返回一个none</p><h5 id="_4-1-定义" tabindex="-1"><a class="header-anchor" href="#_4-1-定义" aria-hidden="true">#</a> 4.1 定义</h5><p>None是Python的一个特殊字面量，其类型是：<code>&lt;class &#39;NoneType&#39;&gt;</code>。<br> 无返回值的函数，实际上就是返回了：None这个字面量。<br> None表示：空的、无实际意义的意思函数返回的None，就表示，这个函数没有返回什么有意义的内容。</p><h5 id="_4-2-return-none-示例" tabindex="-1"><a class="header-anchor" href="#_4-2-return-none-示例" aria-hidden="true">#</a> 4.2 return None 示例</h5><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">get_name</span><span class="token punctuation">(</span>info<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">print</span><span class="token punctuation">(</span><span class="token string-interpolation"><span class="token string">f&quot;this is my name: </span><span class="token interpolation"><span class="token punctuation">{</span>info<span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">)</span>


result1 <span class="token operator">=</span> get_name<span class="token punctuation">(</span><span class="token string">&quot;Victor&quot;</span><span class="token punctuation">)</span>
<span class="token keyword">print</span><span class="token punctuation">(</span>result1<span class="token punctuation">)</span>  <span class="token comment"># None</span>
<span class="token keyword">print</span><span class="token punctuation">(</span><span class="token builtin">type</span><span class="token punctuation">(</span>result1<span class="token punctuation">)</span><span class="token punctuation">)</span>  <span class="token comment"># &lt;class &#39;NoneType&#39;&gt;</span>

<span class="token keyword">def</span> <span class="token function">get_gender</span><span class="token punctuation">(</span>gender<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">return</span> <span class="token boolean">None</span>


result2 <span class="token operator">=</span> get_gender<span class="token punctuation">(</span><span class="token string">&quot;male&quot;</span><span class="token punctuation">)</span>
<span class="token keyword">print</span><span class="token punctuation">(</span>result2<span class="token punctuation">)</span>  <span class="token comment"># None</span>
<span class="token keyword">print</span><span class="token punctuation">(</span><span class="token builtin">type</span><span class="token punctuation">(</span>result2<span class="token punctuation">)</span><span class="token punctuation">)</span>  <span class="token comment"># &lt;class &#39;NoneType&#39;&gt;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h5 id="_4-3-none与bool" tabindex="-1"><a class="header-anchor" href="#_4-3-none与bool" aria-hidden="true">#</a> 4.3 None与bool</h5><p>在if判断中，None等同于False（和数字0一样）。</p><h5 id="_4-4-none的应用场景" tabindex="-1"><a class="header-anchor" href="#_4-4-none的应用场景" aria-hidden="true">#</a> 4.4 None的应用场景</h5><ul><li>用在函数无返回值上</li><li>用在if判断上，表示False <ul><li>函数主动返回None，然后配合if判断做相关处理</li></ul></li><li>定义变量，但暂时不需要变量有具体值，可以用None来代替</li><li>定义方法体，方法必须有方法体，可以先用return None占位</li></ul><h4 id="_5-函数多返回值" tabindex="-1"><a class="header-anchor" href="#_5-函数多返回值" aria-hidden="true">#</a> 5. 函数多返回值</h4><p>函数中只能有一个return，因为return语句会直接退出函数。<br> 当需要多个返回值时，可以并排写在return后面，用逗号风格，接受返回值时用多个变量接收。</p><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">test</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token keyword">return</span> <span class="token number">1</span><span class="token punctuation">,</span> <span class="token string">&quot;a&quot;</span>


x<span class="token punctuation">,</span> y <span class="token operator">=</span> test<span class="token punctuation">(</span><span class="token punctuation">)</span>
<span class="token keyword">print</span><span class="token punctuation">(</span>x<span class="token punctuation">)</span>  <span class="token comment"># 1</span>
<span class="token keyword">print</span><span class="token punctuation">(</span>y<span class="token punctuation">)</span>  <span class="token comment"># a</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="v-函数说明文档" tabindex="-1"><a class="header-anchor" href="#v-函数说明文档" aria-hidden="true">#</a> Ⅴ. 函数说明文档</h2><p>为函数添加多行注释（文档注释），可以方便理解函数。</p><h4 id="_1-语法-1" tabindex="-1"><a class="header-anchor" href="#_1-语法-1" aria-hidden="true">#</a> 1. 语法</h4><p>说明文档要遵循一定的语法，才能有更好的提示。</p><ul><li>内容应写在函数体之前，一定要注意是在函数体之前，而不是函数之前</li><li>使用PyCharm，在函数内部输入三个引号，会自动补齐文档语法的关键字</li></ul><div class="language-python line-numbers-mode" data-ext="py"><pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">get_sum</span><span class="token punctuation">(</span>num1<span class="token punctuation">,</span> num2<span class="token punctuation">)</span><span class="token punctuation">:</span>
    <span class="token triple-quoted-string string">&quot;&quot;&quot;
    该函数是用来计算两数之和的(这里用来写函数的整体说明)
    :param num1: 第一个数字(参数说明)
    :param num2: 第二个数字
    :return: 返回两数之和(返回值说明)
    &quot;&quot;&quot;</span>
    <span class="token keyword">return</span> num1 <span class="token operator">+</span> num2
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_2-查看说明文档" tabindex="-1"><a class="header-anchor" href="#_2-查看说明文档" aria-hidden="true">#</a> 2. 查看说明文档</h4><p>使用函数时，将光标放到函数上，会显示之前定义的说明文档，如下：</p><figure><img src="`+t+'" alt="013" tabindex="0" loading="lazy"><figcaption>013</figcaption></figure>',79),o=[i];function l(c,u){return s(),a("div",null,o)}const d=n(p,[["render",l],["__file","5-1.定义函数.html.vue"]]);export{d as default};
